  false,\n\t\"url\": null,\n\t\"notes\": \"This data set identifies lead levels found
  in blood of waterfowl sampled in Russia and Alaska during 1993-1999. This data set
  includes information on the species, individual identification numbers, age, sex,
  capture location (study area, latitude and longitude, or easting and northing),
  presence or absence of lead shot on x-rays, blood lead levels, weights, and measurements
  of individuals. Because the study took place over a number of years at the same
  study sites, many of the same birds (identified by band number) were sampled in
  multiple years.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"bbox-east-long\",\n\t\t\"value\":
